import React from 'react';
import './App.css';
import HomePage from './home-page';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
    return (<Router>
        <div className={'background-mskcc-light-blue app-body'}>
            <HomePage />
        </div>
    </Router>);
}

export default App;
